import React from 'react';
import './Navmobile.scss';

const NavMobile = () => {
  return (
    <div className="navbar">
      <div className="navbar__item">메인</div>
      <div className="navbar__item">명예의 전당</div>
      <div className="navbar__item">주간 네컷</div>
      <div className="navbar__item">마이 페이지</div>
    </div>
  );
};

export default NavMobile;
